import React from 'react'
import './Header.css'
import {Link} from 'react-router-dom'

function Header() {
    return (
        <nav className="header">
        <Link to="/">
        <img className="header_logo" src="https://thesocialdigital.com/wp-content/uploads/2020/07/R22ASI6HQRE2BANLTBP57PD5EU.jpg"></img>
        </Link>
           
        </nav>
    )
}

export default Header
